# -------------------------------------------------------------------------
# Definição da interface do aplicativo Shiny (UI)
# Este script monta a estrutura visual do app, incluindo menu lateral,
# cabeçalho, corpo e chamadas dos módulos de cada aba.
# -------------------------------------------------------------------------

# Carrega módulos do app --------------------------------------------------

source("R/modules/ncm_mod.R")        # carrega aba Rasteador NCM
source("R/modules/naladi_mod.R")     # carrega aba Rastreador NALADI
source("R/modules/ncm_naladi_mod.R") # carraga aba Rastreador NCM-NALADI
source("R/modules/sobre_mod.R")      # carrega "sobre app"

# Define UI ---------------------------------------------------------------

ui <- dashboardPage(
  title = "Rastreador NCM", # Título da aba do navegador
  dashboardHeader(title = tags$img(src = "rastreador_ncm.png", height = "45px")), # Logo

  # Menu lateral (sidebar)
  dashboardSidebar(
    sidebarMenu(
      id = "tabs", # Identificador das abas para navegação reativa
      menuItem("Sobre", tabName = "sobre"),
      menuItem("Rastreador NCM", tabName = "corr_ncm"),
      menuItem("Rastreador NALADI", tabName = "corr_naladi"),
      menuItem("Rastreador NCM-NALADI", tabName = "corr_ncm_naladi")
    ),

    # Informação de contato fixada ao final da sidebar
    div(
      style = "position: absolute; bottom: 10px; width: 100%; text-align: center; color: #3C8DBC; font-size: 14px;",
      tags$p("Suest / SE-Camex", style = "margin: 0; font-weight: bold;"),
      tags$p(contato, style = "margin: 0;")
    )
  ),

  # Corpo principal do dashboard
  dashboardBody(
    useShinyjs(),
    tags$head(
      tags$style(HTML("
        /* Esconde a barra de rolagem principal */
         body, .wrapper {
          overflow: hidden !important;
          height: 100vh !important;
        }
        /* Garante que o sidebar fique fixo e ocupe toda a altura */
        .main-sidebar {
          position: fixed !important;
          height: 100vh !important;
          overflow-y: auto;
        }
        /* Faz com que só o conteúdo role */
        .content-wrapper, .right-side {
          margin-left: 230px !important; /* Largura padrão da sidebar */
          height: 80vh;
          overflow-y: auto;
        }
        /* Ajusta quando a sidebar está recolhida */
        .sidebar-collapse .main-sidebar {
          width: 0px !important;
        }
        .sidebar-collapse .content-wrapper, 
        .sidebar-collapse .right-side {
          margin-left: 0px !important;
        }
      "))
    ),
    useWaiter(),
    # Definição das abas principais, conectadas aos módulos
    tabItems(
      corr_ncm_module_ui("corr_ncm"),
      corr_naladi_module_ui("corr_naladi"),
      corr_ncm_naladi_module_ui("corr_ncm_naladi"),
      sobre_module_ui("sobre")
    )
  )
)

# Define a interface do painel principal para a aba Rastreador NALADI

corr_naladi_module_ui <- function(id) {
  ns <- NS(id)

  tabItem(tabName = "corr_naladi",
          tags$style(HTML(sprintf("#%s { font-size: 15px; }", ns("apply_filters_naladi")))),

          # Caixa de filtros para seleção de versão e código NALADI
          fluidRow(
            box(
              title = "Filtros",
              status = "primary",
              solidHeader = TRUE,
              width = 12,
              fluidRow(
                column(width = 3,
                       selectInput(
                         inputId = ns("filter1_naladi"),
                         label = "Versão SH-NALADI",
                         choices = unique_sh_naladi,
                         selected = "NALADI 2022"
                       )
                ),
                column(width = 3,
                       selectizeInput(
                         inputId = ns("filter2_naladi"),
                         label = "NALADI",
                         choices = NULL,
                         options = list(
                           placeholder = "Selecionar NALADI",
                           onInitialize = I('function() { this.clear(); }'),

                           # Lógica para buscar códigos com prefixo digitado
                           onType = I('function(str) {
                             var self = this;
                             if (str.length === 0) {
                               self.clearOptions();
                               self.addOption(self.allOptions);
                               self.refreshOptions(false);
                               return;
                             }
                             var filtered = self.options.filter(function(item) {
                               return item.value.startsWith(str);
                             });
                             self.clearOptions();
                             self.addOption(filtered);
                             self.refreshOptions(false);
                           }')
                         ),
                         selected = NULL
                       )
                ),
                column(width = 4,
                       div(style = "margin-top: 25px;",

                           # Botão para consulta a partir dos filtros
                           actionBttn(
                             inputId = ns("apply_filters_naladi"),
                             label = tagList(
                               icon("search"),
                               "Consultar"),
                             style = "jelly",
                             color = "primary",
                             size = "md"
                           )
                       )
                )
              ),

              # Renderiza legenda do gráfico
              fluidRow(
                column(
                  width = 12,
                  uiOutput(ns("legenda_ui_naladi"))
                )
              )
            )
          ),

          # Outputs dinâmicos: botão de download e tabela filtrada
          uiOutput(ns("download_tabela_ui_naladi")),
          uiOutput(ns("filtered_table_ui_naladi")),
          br(),

          # Output gráfico
          tags$div(
            style = "min-height:350px;",
            uiOutput(ns("diagrammer_plot_ui_naladi"))
          )
  )
}

corr_naladi_module_server <- function(input, output, session, reset_trigger) {

  ns <- session$ns  # Garantir acesso ao namespace

  # waiter
  custom_waiter <- Waiter$new(
    id    = ns("diagrammer_plot_ui_naladi"),
    html  = custom_spinner,
    color = "rgba(0,0,0,0)"
  )

  # Variáveis reativas de controle
  filtered_data_naladi <- reactiveVal(NULL)
  reactive_filter1_naladi <- reactiveVal(NULL)
  reactive_filter2_naladi <- reactiveVal(NULL)
  show_table_naladi <- reactiveVal(FALSE)

  # Ao mudar de aba, reseta os dados e inputs
  observeEvent(reset_trigger(), {

    filtered_data_naladi(NULL)
    reactive_filter1_naladi(NULL)
    reactive_filter2_naladi(NULL)
    show_table_naladi(FALSE)

    updateSelectizeInput(session, "filter2_naladi", selected = "", choices = NULL)
  })

  # Reseta ao alterar filtros
  observeEvent(c(input$filter1_naladi, input$filter2_naladi), {

    filtered_data_naladi(NULL)
    reactive_filter1_naladi(NULL)
    reactive_filter2_naladi(NULL)
    show_table_naladi(FALSE)

  }, ignoreInit = TRUE)

  # Habilita botão de consulta somente quando ambos filtros estão preenchidos
  observe({
    filter1_selected <- !is.null(input$filter1_naladi) && input$filter1_naladi != ""
    filter2_selected <- !is.null(input$filter2_naladi) && input$filter2_naladi != ""
    if (filter1_selected && filter2_selected) {
      shinyjs::enable("apply_filters_naladi")
    } else {
      shinyjs::disable("apply_filters_naladi")
    }
  })

  # Atualiza os códigos disponíveis conforme a versão do SH selecionada
  observe({
    req(input$filter1_naladi)
    filtered_naladi <- df_naladi %>%
      filter(revisao == input$filter1_naladi) %>%
      pull(codigo) %>%
      unique() %>%
      sort()
    updateSelectizeInput(
      session,
      inputId = "filter2_naladi",
      choices = filtered_naladi,
      server = TRUE,
      selected = ""
    )
  })

  # Aplica os filtros e gera input de dados ao clicar em "Consultar"
  observeEvent(input$apply_filters_naladi, {
    req(input$filter1_naladi, input$filter2_naladi)
    filtered <- df_naladi %>%
      filter(
        revisao == input$filter1_naladi,
        codigo == input$filter2_naladi
      )
    filtered_data_naladi(filtered)
    reactive_filter1_naladi(input$filter1_naladi)
    reactive_filter2_naladi(input$filter2_naladi)
    show_table_naladi(FALSE)
  })

  # Renderiza a legenda do gráfico
  output$legenda_ui_naladi <- renderUI({
    div(
      style = "display: flex; justify-content: center; align-items: center;",
      grVizOutput(session$ns("legenda_plot_naladi"), width = "100%", height = "auto")
    )
  })

  output$legenda_plot_naladi <- renderGrViz({
    cria_legenda()
  })

  # Renderiza botão de download e botão de visualização da tabela
  output$download_tabela_ui_naladi <- renderUI({
    req(filtered_data_naladi())
    fluidRow(
      column(
        width = 12,
        div(
          style = "background-color: #3C8DBC; padding: 15px; border-radius: 5px; text-align: center;",
          div(
            style = "display: inline-block; margin-right: 10px;",
            downloadButton(
              session$ns("download_filtered_data_naladi"),
              "Baixar dados",
              class = "btn btn-secondary"
            )
          ),
          div(
            style = "display: inline-block;",
            actionButton(
              session$ns("toggle_table_naladi"),
              label = ifelse(
                show_table_naladi(),
                tagList(icon("eye-slash"), " Ocultar dados"),
                tagList(icon("eye"), " Mostrar dados")
              ),
              class = "btn btn-secondary"
            )
          )
        )
      )
    )
  })

  # Lógica de download da tabela filtrada
  output$download_filtered_data_naladi <- downloadHandler(
    filename = function() {
      "correlacao_naladi.xlsx"
    },
    content = function(file) {
      if (nrow(filtered_data_naladi()) > 0) {
        write_xlsx(filtered_data_naladi() %>% 
                     select(all_of(col_unique_sh_naladi)), path = file)
      } else {
        write_xlsx(data.frame(Mensagem = "Nenhum dado disponível"), path = file)
      }
    }
  )

  # Renderiza a tabela se o botão "Visualizar dados" estiver ativo
  output$filtered_table_ui_naladi <- renderUI({
    req(filtered_data_naladi())
    if (show_table_naladi()) {
      fluidRow(
        box(
          width = 12,
          DTOutput(session$ns("filtered_table_naladi"))
        )
      )
    } else {
      NULL
    }
  })

  # Gera a tabela de dados filtrados
  output$filtered_table_naladi <- renderDT({
    req(nrow(filtered_data_naladi()) > 0)
    datatable(filtered_data_naladi() %>%
                select(all_of(col_unique_sh_naladi)), options = list(
                  pageLength = linhas_tabela_shiny,
                  dom = 'ltipr',
                  language = list(
                    lengthMenu = 'Mostrar _MENU_ entradas',
                    info = 'Mostrando _START_ a _END_ de _TOTAL_ entradas',
                    infoEmpty = 'Mostrando 0 a 0 de 0 entradas',
                    infoFiltered = '(filtrado de _MAX_ entradas no total)',
                    paginate = list(
                      previous = 'Anterior',
                      `next` = 'Próximo'
                    )
                  )
                ),
              rownames = FALSE
    )
  })

  # Alterna entre mostrar e esconder a tabela
  observeEvent(input$toggle_table_naladi, {
    req(filtered_data_naladi())
    show_table_naladi(!show_table_naladi())
  })

  # Atualiza o texto do botão conforme o estado da visualização
  observe({
    req(filtered_data_naladi())
    updateActionButton(session, "toggle_table_naladi", 
                       label = ifelse(show_table_naladi(), "Ocultar Dados", "Mostrar dados"))
  })

  # Renderiza o gráfico ou mensagens de erro dependendo da quantidade de linhas
  output$diagrammer_plot_ui_naladi <- renderUI({
    req(filtered_data_naladi())
    if(nrow(filtered_data_naladi()) == 0) {
      h4(
        "Código selecionado não existe para a versão NALADI selecionada. Por favor, selecione outro código.",
        style = "color: red;"
      )
    } else if(nrow(filtered_data_naladi()) <= limite_maximo_linhas) {
      fluidRow(
        bs4Dash::box(
          width = 12,
          collapsible = FALSE,
          grVizOutput(session$ns("diagrammer_plot_naladi"), width = "100%", height = "auto")
        )
      )
    } else {
      h4(
        "Limite de ", limite_maximo_linhas, " linhas excedido. Para ver correlação, baixe ou visualize os dados.", 
        style = "color: red;")
    }
  })

  # Gera o gráfico com base nos dados filtrados
  output$diagrammer_plot_naladi <- renderGrViz({
    req(filtered_data_naladi())
    req(nrow(filtered_data_naladi()) <= limite_maximo_linhas)
    custom_waiter$show()  
    on.exit(custom_waiter$hide())
    diagrammer_plot(
      filtered_data_naladi(), 
      codigo_filtro = reactive_filter2_naladi(), 
      revisao_filtro = reactive_filter1_naladi()
      ) %>% 
      htmlwidgets::onRender("
        function(el) {
          el.querySelectorAll('g.node').forEach(function(node) {
            var t   = node.querySelector('text');
            var txt = t ? t.textContent.replace(/\\u00A0/g, '').trim() : '';
            node.style.cursor = /N:/.test(txt) ? 'help' : 'default';
          });
        }
  ")
  })

}

