    id    = ns("diagrammer_plot_ui_ncm_naladi"),
    html  = custom_spinner,
    color = "rgba(0,0,0,0)"  
  )

  # Variáveis reativas de controle
  filtered_data_ncm_naladi <- reactiveVal(NULL)
  reactive_filter1_ncm_naladi <- reactiveVal(NULL)
  show_table_ncm_naladi <- reactiveVal(FALSE)

  # Ao mudar de aba, reseta os dados e inputs
  observeEvent(reset_trigger(), {

    filtered_data_ncm_naladi(NULL)
    reactive_filter1_ncm_naladi(NULL)
    show_table_ncm_naladi(FALSE)

    updateSelectizeInput(session, "filter1_ncm_naladi", selected = "")
  })


