    if (reset_first_time()) {

      filtered_data_ncm_naladi(NULL)
      reactive_filter1_ncm_naladi(NULL)
      show_table_ncm_naladi(FALSE)


      updateSelectizeInput(session, "filter1_ncm_naladi", selected = "")


      reset_first_time(FALSE)
    }
  })

