      filter(revisao == ultimo_naladi_espaco) %>% 
      filter(!!sym(ultimo_naladi) %in% codigo_naladi) %>% 
      left_join(
        filtered, by = ultimo_naladi
        )

    filtered_data_ncm_naladi(filtered)
    reactive_filter1_ncm_naladi(input$filter1_ncm_naladi)
    show_table_ncm_naladi(FALSE)
