# A funcao afere_reutilizado_atras é auxiliar e é utilizada dentro da função
# cria_nodes_abertura_atras. O objetivo da função consiste em conferir se
# algum código dentro do nó outros em uma revisão anterior é igual ao código do
# nó ao qual está conectado na revisão seguinte. Caso um código dentro do nó
# outros seja igual ao código do nó na revisão seguinte a função retornará o
# termo reutilizado.

afere_reutilizado_atras <- function(entrada) {
  tp <- entrada %>% 
    filter(col1 == col2) 

  if(nrow(tp) > 0) {
    return("reutilizado")
  }

  return("diferente")
}

# get_reutilizado é uma funcao auxiliar de diagrammer_plot para gerar 
# parte dos codigos reutilizados

get_reutilizado <- function(df, x) {

  node_min <- df %>% 
    filter(ncm1 == x) %>% 
    filter(node1 == min(node1)) %>% 
    pull(node1) %>% 
    unique()

  temp <- df %>% 
    filter(ncm2 == x & ncm1 != x)

  if(nrow(temp) > 0) {
    node_reutilizado <- temp %>% 
      pull(node2) %>% 
      unique()

    if(length(node_reutilizado) > 1) {
      vetor_resultado <- vector('double')

      for(k in node_reutilizado) {
        if(k > node_min) {
          vetor_resultado <- c(vetor_resultado, k)
        }
      }

      return(vetor_resultado)
    }

    if(node_reutilizado > node_min) {
      return(node_reutilizado)
    } 
  }

  return(-1)

}
